import React from 'react';

const Header =(props) => {
    return (
        <header id="gnv">
        <nav id="headerGNV">
          <section id="headerLogo">Simon Lee</section>
          <section id="headerMenu">
            <ul>
              <li><a data-page="home" href="#main">Home</a></li>
              <li><a data-page="aboutMe" href="#aboutMeBody">About Me</a></li>
              <li><a data-page="portfolio" href="#portfolioBody">Portfolio</a></li>
              <li><a data-page="contact" href="#contactBody">Contact</a></li>
            </ul>
          </section>
        </nav>
      </header>
    );
}

export default Header;
